import { ComponentTradeActionTypes, ComponentTradeState } from "./types";

export function componentTradeReducer(
  state: ComponentTradeState = null,
  action: ComponentTradeActionTypes
) {
  switch (action.type) {
    default:
      return state;
  }
}
